import React from 'react';
import { projects } from '../../data'

const Projects = () => {
    console.log(projects)
    return (
        <div style={{ height: '245vh'}}>
            <div>
                {projects.map(project => (
                    <div style={{backgroundColor: '#F4F4F4', margin: '1rem 1.5rem', height: '75vh'}}>
                        <h2>{project.name}</h2>
                        <h4>{project.subtitle}</h4>
                    </div>
                ))}
            </div>
        </div>
    )
}

export default Projects;
